{
  "name": "UBX-NAV-PVAT",
  "class_id": "0x01",
  "message_id": "0x17",
  "description": "Navigation position velocity attitude time solution",
  "message_type": "output",
  "payload": {
    "length": {
      "fixed": 116
    },
    "fields": [
      {
        "name": "iTOW",
        "byte_offset": 0,
        "data_type": "U4",
        "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details.",
        "unit": "ms"
      },
      {
        "name": "version",
        "byte_offset": 4,
        "data_type": "U1",
        "description": "Message version (0x00 for this version)"
      },
      {
        "name": "valid",
        "byte_offset": 5,
        "data_type": "X1",
        "description": "Validity flags",
        "bitfield": {
          "bits": [
            {
              "name": "validDate",
              "bit_start": 0,
              "bit_end": 0,
              "description": "1 = valid UTC Date (see section Time validity in the integration manual for details)"
            },
            {
              "name": "validTime",
              "bit_start": 1,
              "bit_end": 1,
              "description": "1 = valid UTC time of day (see section Time validity in the integration manual for details)"
            },
            {
              "name": "fullyResolved",
              "bit_start": 2,
              "bit_end": 2,
              "description": "1 = UTC time of day has been fully resolved (no seconds uncertainty). Cannot be used to check if time is completely solved."
            },
            {
              "name": "validMag",
              "bit_start": 3,
              "bit_end": 3,
              "description": "1 = valid magnetic declination"
            }
          ]
        }
      },
      {
        "name": "year",
        "byte_offset": 6,
        "data_type": "U2",
        "description": "Year (UTC)",
        "unit": "y"
      },
      {
        "name": "month",
        "byte_offset": 8,
        "data_type": "U1",
        "description": "Month, range 1..12 (UTC)",
        "unit": "month"
      },
      {
        "name": "day",
        "byte_offset": 9,
        "data_type": "U1",
        "description": "Day of month, range 1..31 (UTC)",
        "unit": "d"
      },
      {
        "name": "hour",
        "byte_offset": 10,
        "data_type": "U1",
        "description": "Hour of day, range 0..23 (UTC)",
        "unit": "h"
      },
      {
        "name": "min",
        "byte_offset": 11,
        "data_type": "U1",
        "description": "Minute of hour, range 0..59 (UTC)",
        "unit": "min"
      },
      {
        "name": "sec",
        "byte_offset": 12,
        "data_type": "U1",
        "description": "Seconds of minute, range 0..60 (UTC)",
        "unit": "s"
      },
      {
        "name": "reserved0",
        "byte_offset": 13,
        "data_type": "U1",
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "reserved1",
        "byte_offset": 14,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "tAcc",
        "byte_offset": 16,
        "data_type": "U4",
        "description": "Time accuracy estimate (UTC)",
        "unit": "ns"
      },
      {
        "name": "nano",
        "byte_offset": 20,
        "data_type": "I4",
        "description": "Fraction of second, range -1e9 .. 1e9 (UTC)",
        "unit": "ns"
      },
      {
        "name": "fixType",
        "byte_offset": 24,
        "data_type": "U1",
        "description": "GNSSfix Type: 0 = no fix, 1 = dead reckoning only, 2 = 2D-fix, 3 = 3D-fix, 4 = GNSS + dead reckoning combined, 5 = time only fix"
      },
      {
        "name": "flags",
        "byte_offset": 25,
        "data_type": "X1",
        "description": "Fix status flags",
        "bitfield": {
          "bits": [
            {
              "name": "gnssFixOK",
              "bit_start": 0,
              "bit_end": 0,
              "description": "1 = valid fix (i.e within DOP & accuracy masks)"
            },
            {
              "name": "diffSoln",
              "bit_start": 1,
              "bit_end": 1,
              "description": "1 = differential corrections were applied"
            },
            {
              "name": "vehRollValid",
              "bit_start": 3,
              "bit_end": 3,
              "description": "1 = roll of vehicle is valid, only set if the receiver is in sensor fusion mode"
            },
            {
              "name": "vehPitchValid",
              "bit_start": 4,
              "bit_end": 4,
              "description": "1 = pitch of vehicle is valid, only set if the receiver is in sensor fusion mode"
            },
            {
              "name": "vehHeadingValid",
              "bit_start": 5,
              "bit_end": 5,
              "description": "1 = heading of vehicle is valid, only set if the receiver is in sensor fusion mode"
            },
            {
              "name": "carrSoln",
              "bit_start": 6,
              "bit_end": 7,
              "description": "Carrier range solution status: 0 = no carrier range solution, 1 = carrier range solution with float ambiguities, 2 = carrier range solution with fixed ambiguities"
            }
          ]
        }
      },
      {
        "name": "flags2",
        "byte_offset": 26,
        "data_type": "X1",
        "description": "Additional flags",
        "bitfield": {
          "bits": [
            {
              "name": "confirmedAvai",
              "bit_start": 5,
              "bit_end": 5,
              "description": "1 = information about UTC Date and Time of Day validity confirmation is available (see section Time validity in the integration manual for details)"
            },
            {
              "name": "confirmedDate",
              "bit_start": 6,
              "bit_end": 6,
              "description": "1 = UTC Date validity could be confirmed (see section Time validity in the integration manual for details)"
            },
            {
              "name": "confirmedTime",
              "bit_start": 7,
              "bit_end": 7,
              "description": "1 = UTC Time of Day could be confirmed (see section Time validity in the integration manual for details)"
            }
          ]
        }
      },
      {
        "name": "numSV",
        "byte_offset": 27,
        "data_type": "U1",
        "description": "Number of satellites used in Nav Solution"
      },
      {
        "name": "lon",
        "byte_offset": 28,
        "data_type": "I4",
        "description": "Longitude",
        "unit": "deg",
        "scale": {
          "raw": "1e-7",
          "multiplier": 1e-7
        }
      },
      {
        "name": "lat",
        "byte_offset": 32,
        "data_type": "I4",
        "description": "Latitude",
        "unit": "deg",
        "scale": {
          "raw": "1e-7",
          "multiplier": 1e-7
        }
      },
      {
        "name": "height",
        "byte_offset": 36,
        "data_type": "I4",
        "description": "Height above ellipsoid",
        "unit": "mm"
      },
      {
        "name": "HMSL",
        "byte_offset": 40,
        "data_type": "I4",
        "description": "Height above mean sea level",
        "unit": "mm"
      },
      {
        "name": "hAcc",
        "byte_offset": 44,
        "data_type": "U4",
        "description": "Horizontal accuracy estimate",
        "unit": "mm"
      },
      {
        "name": "vAcc",
        "byte_offset": 48,
        "data_type": "U4",
        "description": "Vertical accuracy estimate",
        "unit": "mm"
      },
      {
        "name": "velN",
        "byte_offset": 52,
        "data_type": "I4",
        "description": "NED north velocity",
        "unit": "mm/s"
      },
      {
        "name": "velE",
        "byte_offset": 56,
        "data_type": "I4",
        "description": "NED east velocity",
        "unit": "mm/s"
      },
      {
        "name": "velD",
        "byte_offset": 60,
        "data_type": "I4",
        "description": "NED down velocity",
        "unit": "mm/s"
      },
      {
        "name": "gSpeed",
        "byte_offset": 64,
        "data_type": "I4",
        "description": "Ground Speed (2-D)",
        "unit": "mm/s"
      },
      {
        "name": "sAcc",
        "byte_offset": 68,
        "data_type": "U4",
        "description": "Speed accuracy estimate",
        "unit": "mm/s"
      },
      {
        "name": "vehRoll",
        "byte_offset": 72,
        "data_type": "I4",
        "description": "Vehicle roll.",
        "unit": "deg",
        "scale": {
          "raw": "1e-5",
          "multiplier": 1e-5
        }
      },
      {
        "name": "vehPitch",
        "byte_offset": 76,
        "data_type": "I4",
        "description": "Vehicle pitch.",
        "unit": "deg",
        "scale": {
          "raw": "1e-5",
          "multiplier": 1e-5
        }
      },
      {
        "name": "vehHeading",
        "byte_offset": 80,
        "data_type": "I4",
        "description": "Vehicle heading.",
        "unit": "deg",
        "scale": {
          "raw": "1e-5",
          "multiplier": 1e-5
        }
      },
      {
        "name": "motHeading",
        "byte_offset": 84,
        "data_type": "I4",
        "description": "Motion heading.",
        "unit": "deg",
        "scale": {
          "raw": "1e-5",
          "multiplier": 1e-5
        }
      },
      {
        "name": "accRoll",
        "byte_offset": 88,
        "data_type": "U2",
        "description": "Vehicle roll accuracy (if null, roll angle is not available).",
        "unit": "deg",
        "scale": {
          "raw": "1e-2",
          "multiplier": 1e-2
        }
      },
      {
        "name": "accPitch",
        "byte_offset": 90,
        "data_type": "U2",
        "description": "Vehicle pitch accuracy (if null, pitch angle is not available).",
        "unit": "deg",
        "scale": {
          "raw": "1e-2",
          "multiplier": 1e-2
        }
      },
      {
        "name": "accHeading",
        "byte_offset": 92,
        "data_type": "U2",
        "description": "Vehicle heading accuracy (if null, heading angle is not available).",
        "unit": "deg",
        "scale": {
          "raw": "1e-2",
          "multiplier": 1e-2
        }
      },
      {
        "name": "magDec",
        "byte_offset": 94,
        "data_type": "I2",
        "description": "Magnetic declination.",
        "unit": "deg",
        "scale": {
          "raw": "1e-2",
          "multiplier": 1e-2
        }
      },
      {
        "name": "magAcc",
        "byte_offset": 96,
        "data_type": "U2",
        "description": "Magnetic declination accuracy.",
        "unit": "deg",
        "scale": {
          "raw": "1e-2",
          "multiplier": 1e-2
        }
      },
      {
        "name": "errEllipseOrient",
        "byte_offset": 98,
        "data_type": "U2",
        "description": "Orientation of semi-major axis of error ellipse (degrees from true north)",
        "unit": "deg",
        "scale": {
          "raw": "1e-2",
          "multiplier": 1e-2
        }
      },
      {
        "name": "errEllipseMajor",
        "byte_offset": 100,
        "data_type": "U4",
        "description": "Semi-major axis of error ellipse",
        "unit": "mm"
      },
      {
        "name": "errEllipseMinor",
        "byte_offset": 104,
        "data_type": "U4",
        "description": "Semi-minor axis of error ellipse",
        "unit": "mm"
      },
      {
        "name": "reserved2",
        "byte_offset": 108,
        "data_type": {
          "array_of": "U1",
          "count": 4
        },
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "reserved3",
        "byte_offset": 112,
        "data_type": {
          "array_of": "U1",
          "count": 4
        },
        "description": "Reserved",
        "reserved": true
      }
    ]
  }
